import React, { useEffect, useState } from "react";
import data from "./VennDiagram";

const VennData = () => {
  const [commonAB, setCommonAB] = useState(0);
  const [uniqueA, setUniqueA] = useState(0);
  const [uniqueB, setUniqueB] = useState(0);

  useEffect(() => {
    fetch("./venn_out_data (1).txt")
      .then((response) => response.text())
      .then((text) => parseData(text))
      .catch((error) => console.error("Error fetching data:", error));
  }, []);

  const parseData = (text) => {
    const lines = text.trim().split("\n").slice(1); // Split the text by newlines and ignore the header line
    let commonCount = 0,
      uniqueACount = 0,
      uniqueBCount = 0;

    lines.forEach((line) => {
      const [common, uniqueA, uniqueB] = line.split(/\s+/); // Split each line by whitespace

      if (common !== "NA") commonCount += 1;
      if (uniqueA !== "NA") uniqueACount += 1;
      if (uniqueB !== "NA") uniqueBCount += 1;
    });

    setCommonAB(commonCount);
    setUniqueA(uniqueACount);
    setUniqueB(uniqueBCount);
  };

  return (
    <div>
      <h3>Venn Diagram Data</h3>
      <p>Common A B: {commonAB}</p>
      <p>Unique A: {uniqueA}</p>
      <p>Unique B: {uniqueB}</p>
    </div>
  );
};

export default VennData;
